style.css:
@-moz-document domain("cabinet.ruobr.ru") {
.c-top {
    height: 75px;
    position: fixed;
    left: 0px;
    top: 0px;
    width: 125%;
    background-color: #6600ff;
    /* background: linear-gradient(#7c9885 0%, #373737 100%);*/
    box-shadow: 0px 0px 0px rgb(105 105 105 / 0%);
}
body {
    background: #0000
}
html {
     background: url(https://sun9-4.userapi.com/impg/b5utaDIL45vbOQMttI7p9MTfOIkixaPr2QM_JQ/9arywW--Idk.jpg?size=1280x720&quality=96&sign=38f930cc1cfdffb8a710db3feed8cd3f&type=album) no-repeat center center fixed;
    background-repeat: no-repeat;
    -khtml-background-size: cover;
    -moz-background-size: cover;
    -ms-background-size: cover;
    -o-background-size: cover;
    -webkit-background-size: cover;
    background-size: cover;
}
body {
    font-family: system-ui;
    margin: 0px;
    padding: 0px;
}
.left-menu .general-menu li a {
    color: #f2ccc3;
    display: block;
    padding: 15px 15px;
    border-radius: 3px;
    outline: none;
}
.left-menu .general-menu li.active a {
    background-color: #9381ff;
    color: #373737;
    border-radius: 25px;
}
.c-container .c-content {
    display: inline-block;
    vertical-align: top;
    position: relative;
    width: 820px;
    margin-bottom: 10px;
    padding: 15px 5px;
    background-color: #ffff;
    border: 12px outset #00bff;
    border-radius: 45px;
    box-shadow: 0px 0px 0px #dadbdb;
}
.c-btn, .cabinet-btn, .ruobr-btn, .btn {
    display: inline-block;
    cursor: pointer;
    background-color: #2493e5;
    color: #ffff;
    text-decoration: none;
    padding: 14px 20px;
    font-size: 16px;
    border-radius: 25px;
    border: none;
    background-image: none;
}
.ruobr-well {
    padding: 10px;
    border-radius: 22px;
    border: 12px outset #00bff;
    margin-bottom: 12px;
    background-color: #8b00ff;
    color: #4a4a4a;
}
::-webkit-scrollbar-thumb {
    background: linear-gradient(92deg, #00bfff, #8b00ff);
}
.left-menu {
    position: fixed;
    width: 160px;
}
h2 {
    font-size: 20px;
    letter-spacing: -0.03em;
    line-height: 15px;
}
.birthday {
    padding: 3px;
}
.ui.card>.image>img, .ui.cards>.card>.image>img {
    display: block;
    width: 0px;
    height: 15px;
    border-radius: inherit;
}
.c-container a {
    color: #1f7cc2;
}
.background {
    background: url(https://sun9-4.userapi.com/impg/b5utaDIL45vbOQMttI7p9MTfOIkixaPr2QM_JQ/9arywW--Idk.jpg?size=1280x720&quality=96&sign=38f930cc1cfdffb8a710db3feed8cd3f&type=album) no-repeat center center fixed;
    background-repeat: no-repeat;
    -khtml-background-size: cover;
    -moz-background-size: cover;
    -ms-background-size: cover;
    -o-background-size: cover;
    -webkit-background-size: cover;
    background-size: cover;
}
}
@-moz-document url-prefix("https://cabinet.ruobr.ru/login/") {
.background {
    background: url(https://sun9-4.userapi.com/impg/b5utaDIL45vbOQMttI7p9MTfOIkixaPr2QM_JQ/9arywW--Idk.jpg?size=1280x720&quality=96&sign=38f930cc1cfdffb8a710db3feed8cd3f&type=album) no-repeat center center fixed;
    background-repeat: no-repeat;
    -khtml-background-size: cover;
    -moz-background-size: cover;
    -ms-background-size: cover;
    -o-background-size: cover;
    -webkit-background-size: cover;
    background-size: cover;
}
.ui[class*="two column"].grid > .column:not(.row), .ui[class*="two column"].grid > .row > .column {
    width: 100%;
}
.ui.icon.header:first-child {
    margin-top: 0;
    font-size: 35px;
}
.ui.segment:last-child {
    margin-bottom: 0;
    padding: 61px 150px 300px 150px;
}
html {
    font-size: 14px;
    background: #0000;
}
.ui.ui.ui.ui[class*="left icon"].input > input, .ui.ui.ui.ui[class*="left icon"].input > textarea {
    border-radius: 76px;
}
.ui.primary.button, .ui.primary.buttons .button {
    border-radius: 75px;
}
.ui.fluid.button {
    display: block;
    border-radius: 75px;
}
}
@-moz-document url-prefix("https://cabinet.ruobr.ru/child/mail") {
.ui-dialog .ui-dialog-titlebar {
    border-color: #ffffff00;
    padding: 20px 21px;
    font-size: 24px;
    border-bottom: 1px solid #999;
}

p {
    font-size: 17px;
    font-weight: lighter;
    line-height: 14px;
    padding: 25px 4px 21px 5px;
}

.ui-dialog-buttonpane .ui-dialog-buttonset .ui-button{
    
border-radius: 55px;
}
}
